import React from "react";
import "./App.scss";
import Register from "./pages/ragisterPage/Register";
import { createBrowserRouter, RouterProvider, Route } from "react-router-dom";
const App = () => {
  const router = createBrowserRouter([
    {
      path: "/",
      element: <div>Hello world!</div>,
    },
  ]);
  return (
    <div>
      <Register />
    </div>
  );
};

export default App;
